import React from "react"; 
import './App.css';
import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="App">
      <Navbar/>      
           <h1>Terry Agabi</h1>
          <p>Welcome to Terry Agabi website.</p>
        <a
          className="App-link"
          href="https://www.linkedin.com/in/terryagabi/"
          target="_blank"
          rel="noopener noreferrer"
        >
          linkedin
        </a>
        <p></p>
        <a
          className="App-link"
          href="https://github.com/TechT360"
          target="_blank"
          rel="noopener noreferrer"
        >
          Github
        </a>
         </div>
  );
}

export default App;
